import React, { Component } from 'react';
import { Badge, Card, CardBody, CardHeader, Col, Pagination, PaginationItem, PaginationLink, Row, Table } from 'reactstrap';
import { connect } from 'react-redux'
import { Provider } from 'react-redux'
import {loadUser} from '../../../redux/actions/usertouser'

var store = require('../../../redux/store')
const axios = require('axios');
class UserToUser extends Component {
  componentDidMount() {
    let self = this;
    this.props.loadUser;
    // axios.get('/transaction/usertouser/listUserToUser')
    //   .then(function (response) {
    //     // handle success
    //     let details = [];
    //     // var empObj = JSON.parse(response.data);
    //     console.log(response.data[0].Name);
    //     // console.log(empObj);
    //     // var {dispatch}=this.props;
    //     store.dispatch({ type: 'LOAD_LIST_USERTOUSER', item: response.data });
    //     console.log(store.getState());
    //   })
    //   .catch(function (error) {
    //     // handle error
    //     console.log(error);
    //   })
    //   .then(function () {
    //     // always executed
    //   });
  }
  render() {
    return (
      <Provider store={store}>
        <div className="animated fadeIn">
          <Row>
            <Col xs="12" lg="12">
              <Card>
                <CardHeader>
                  <i className="fa fa-align-justify"></i> Simple Table
              </CardHeader>
                <CardBody>
                  <Table responsive>
                    <thead>
                      <tr>
                        <th>Name</th>
                        <th>Target</th>
                        <th>Money</th>
                        <th>Description</th>
                        <th>DateGet</th>
                        <th>URL_FULL</th>
                      </tr>
                    </thead>
                    <tbody>

                    </tbody>
                  </Table>
                  <Pagination>
                    <PaginationItem>
                      <PaginationLink previous tag="button"></PaginationLink>
                    </PaginationItem>
                    <PaginationItem active>
                      <PaginationLink tag="button">1</PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                      <PaginationLink tag="button">2</PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                      <PaginationLink tag="button">3</PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                      <PaginationLink tag="button">4</PaginationLink>
                    </PaginationItem>
                    <PaginationItem>
                      <PaginationLink next tag="button"></PaginationLink>
                    </PaginationItem>
                  </Pagination>
                </CardBody>
              </Card>
            </Col>
          </Row>
        </div>
      </Provider>
    );
  }
}

const mapStateToProps = state => ({
  listUserToUser: state.listUserToUser,
  loadUser: state.loadUser
})
// export default UserToUser;
export default connect(mapStateToProps, { loadUser })(UserToUser);
